import React from 'react';
import './Login.scss';
import Modal from 'react-modal';
const customStyles = {
  content: {
    backgroundColor: 'blue',
    top: '50%',
    left: '50%',
    right: 'auto',
    bottom: 'auto',
    marginRight: '-50%',
    transform: 'translate(-50%, -50%)',
    height: '50vh'
  }
};

// Modal.setAppElement('#yourAppElement')

const Login = () => {
  const IsOpen = false;
  const openModal=()=>{
    IsOpen = false;
    document.getElementById("modal").style.display="block"
  }
  const closeModal=()=>{
    IsOpen = true;
    document.getElementById("modal").style.display="none"

  }
  return (
    <>
      <div id="screen" onClick={closeModal} >
        <button onClick={openModal}>Open Modal</button>
        <div className="modal">
          <button className="modal" onClick={closeModal}>Close Modal</button>
        </div>
      </div>
    </>
  );
}

export default Login;
